function Campos(){
    return(
        <div className='flex flex-col gap-y-8 p-16'>
            <div className='flex gap-x-24'>
                    <label className='text-3xl text-white font-bold'>
                        Nome:
                    </label>
                    <input className='bg-slate-200 rounded-xl w-[350px] p-2' id='nome_fornecedor'/>
                </div>
            </div>
    );   
};

export default Campos;
